sB("common/io/promise.effekt",'module io/promise\n\nimport io\nimport io/signal\n\n// Promises\n// --------\n\ntype State[T] {\n  Pending(signals: List[Signal[T, Unit]])\n  Resolved(value: T)\n}\n\ntype Promise[T] \x3d Ref[State[T]]\n\nnamespace promise {\n  /// Creates a pending promise that must be resolved exactly once\n  /// and can be awaited multiple times.\n  def make[T](): Promise[T] \x3d\n    ref(Pending(Nil()))\n}\n\n/// Spawns a task and immediately returns a promise that upon completion\n/// of the task will resolve to its result.\ndef promise[T](task: () \x3d\x3e T at {io, async, global}): Promise[T] \x3d {\n  val p \x3d promise::make[T]();\n  spawn(box { p.resolve(task()) });\n  return p\n}\n\n/// Awaits and blocks until the given promise is resolved.\ndef await[T](promise: Promise[T]): T \x3d\n  promise.get match {\n    case Resolved(value) \x3d\x3e\n      return value\n    case Pending(signals) \x3d\x3e\n      val signal \x3d signal()\n      promise.set(Pending(Cons(signal, signals)))\n      // TODO perhaps yield to avoid stack overflow\n      signal.unsafeWait(())\n  }\n\n/// Resolves the given promise, unblocking all awaiting tasks.\ndef resolve[T](promise: Promise[T], value: T): Unit \x3d\n  promise.get match {\n    case Resolved(value) \x3d\x3e\n      panic("ERROR: Promise already resolved")\n    case Pending(signals) \x3d\x3e\n      promise.set(Resolved(value))\n      // TODO perhaps yield to avoid stack overflow\n      signals.reverse.foreach { signal \x3d\x3e unsafeFire(signal, value) }\n  }\n\n');
